import axios from 'axios';

//export baseURL 
export const baseURL = 'http://localhost:000/';

const instance = axios.create({
    baseURL: 'http://localhost:4000',
    headers: { 'authorization': localStorage.getItem('accesstoken') }

});
export default instance
